<body class="vsc-initialized sticky-ready" data-test="landingpage-app">

  <div class="site-bg" data-test="landingpage-bg">

    <img src="./Gill - Joke_files/artwork-440x440.jpg" data-test="landingpage-bg-image" role="presentation">
  </div>

  <script>
    (d => {
      try {
        const container = d.querySelector('.ad__container--one-point-five-click');
        const interval = setInterval(() => {
          const iframe = container.querySelector('iframe');

          if (iframe) {
            const container = iframe.contentWindow.document.querySelector('.container');
            const modal = iframe.contentWindow.document.querySelector('.modal');
            const elements = [container, modal];
            const classes = ['overlay', 'modal--visible'];

            elements.forEach((el, i) => el.classList.remove(classes[i]));

            clearInterval(interval);
          }
        }, 500);
      } catch (error) {
        console.error(error);
      }
    })(document);
  </script>

  <main class="layout" data-test="layout-wrapper">
